(function(){"use strict";if("standalone"in window.navigator&&window.navigator.standalone){jQuery(document).ready(function($){$("a").click(function(event){var alink=document.createElement("a");alink.href=$(this).attr("href");if(alink&&alink.protocol.indexOf("http")!==-1&&alink.host.indexOf(document.location.host)!==-1){event.preventDefault();window.location=alink.href}})})}})();